import React from "react";

const Demandes = () => {
  return (
    <div className="demandes-container">
      <div className="demandes-header">
        <img src={process.env.PUBLIC_URL + "imgs/icon.png"} alt="icon" />
        <h1>Demandes</h1>
      </div>
    </div>
  );
};

export default Demandes;
